            [clojure.core.matrix :as m]
            [clojure.core.matrix.linear :as mlin]
            [helpers.gmm :refer [normalize move-to-unit-box gridify]]
            [helpers.general :refer [empirical-MAP]]
            [gorilla-repl.image :as image]
